import React from 'react'



const CityCard = ({ cities }) => {

    const cityCardName = cities.map(city => {

        return (

            <div className="city-card" key={city._id}>
                <h2>{city.name}</h2>
            </div>

        )

    })
    return (
        <div className="flex-container">
            {cityCardName}

        </div>
    )


}



export default CityCard;
